import React from 'react'
import { useGetBrandsByTypeQuery } from '../../redux/api/server.api'
import { useAppSelector } from '../../redux/hooks/hooks'
import './brandNavigation.scss'
export default function BrandNavigation() {
    const type = useAppSelector(state=>state.type.type)
    const {data:typeBrands,isLoading} = useGetBrandsByTypeQuery(type ? type : '')
    if(isLoading){
        return <h1>Loading...</h1>
    }

    console.log(typeBrands)
  return (
    <div className='brandNav'>
      {typeBrands.map((el:any)=>
      <li className='brandNav_el'>{el.name}</li>
      )}
    </div>
  )
}
